import React, { Component } from "react";

class App extends Component {
  render() {
    const req = `https://api.edamam.com/search?q=chicken&app_id=${process.env.App_ID} &app_key=${process.env.APP_KEY}`;
    return (
      <div>
        <form>
          <input type="text"></input>
          <button type="submit">Search</button>
        </form>
      </div>
    );
  }
}
export default App;
